var roles = sessionStorage.getItem('role');
console.log(roles);
let routes;

switch (roles) {
  case 'admin':
    routes = [
      {
        path: "/app/dashboard",
        icon: "HomeIcon",
        name: "Dashboard",
      },
      {
        path: "/app/studentmasters",
        icon: "TablesIcon",
        name: "StudentMaster",
      },
      {
        path: "/app/coursemaster",
        icon: "SiCoursera",
        name: "Course Master",
      },
      {
        path: "/app/assignedcourses",
        icon: "SiCoursera",
        name: "Assigned Courses",
      },
      {
        path: "/app/mycourse",
        icon: "SiCoursera",
        name: "MyCourse",
      },
      {
        path: "/app/courseregistration",
        icon: "FormsIcon",
        name: "CourseRegistration",
      },
      {
        path: "/app/faculty",
        icon: "FaChalkboardTeacher",
        name: "Faculty Mapping",
      },
      {
        path: "/app/curriculum",
        icon: "FormsIcon",
        name: "Curriculum",
      },
    ];
    break;
  case 'student':
    routes = [
      {
        path: "/app/dashboard",
        icon: "HomeIcon",
        name: "Dashboard",
      },
      {
        path: "/app/mycourse",
        icon: "SiCoursera",
        name: "MyCourse",
      },
    ];
    break;
  default:
    // Default routes for unknown or unauthorized users
    routes = [
      {
        path: "/login",
        icon: "LoginIcon",
        name: "Login",
      },
    ];
    break;
}

export default routes;
